package main

import (
	"archive/zip"
	"bytes"
	"encoding/base64"
	"fmt"
	"io/ioutil"
	"strings"
)

const sampleZip = ""

func main() {
	base64Without, err := RemoveDsStore(sampleZip)
	if err != nil {
		fmt.Println(err)
	}
	fmt.Println("Base64:", base64Without)
}

//RemoveDsStore will return a base64 encoded zipFile string with all .DS_Store and __MACOSX files removed
func RemoveDsStore(zipBase64 string) (string, error) {
	//Decode the zipBase64 string to a []byte
	zipBytes, err := base64.StdEncoding.DecodeString(zipBase64)
	if err != nil {
		return "", err
	}

	//Create a file from the zip []byte
	zipFile, err := ioutil.TempFile("", "coolio-zipper*.zip")
	if err != nil {
		return "", err
	}
	defer zipFile.Close()

	_, err = zipFile.Write(zipBytes)
	if err != nil {
		return "", err
	}

	//Open the file, OpenReader, or Open
	zipReadCloser, err := zip.OpenReader(zipFile.Name())
	if err != nil {
		return "", err
	}
	defer zipReadCloser.Close()

	zipBuf := bytes.NewBuffer([]byte{})
	outputZip := zip.NewWriter(zipBuf)

	//Go through each file
	for _, file := range zipReadCloser.File {
		//	Exit if the file is a __MACOSX or .DS_Store
		if file.Name[:8] == "__MACOSX" {
			continue
		}

		fileExtensionIndex := strings.LastIndex(file.Name, ".")
		fileExtension := file.Name[fileExtensionIndex+1:]
		if fileExtension == "DS_Store" {
			continue
		}

		//create the temporary file
		zipFile, err := outputZip.Create(file.Name)
		if err != nil {
			return "", err
		}

		fileReadCloser, err := file.Open()
		if err != nil {
			return "", err
		}

		fileBytes, err := ioutil.ReadAll(fileReadCloser)
		if err != nil {
			return "", err
		}

		zipFile.Write(fileBytes)

		fileReadCloser.Close()
	}

	base64Without := base64.StdEncoding.EncodeToString(zipBuf.Bytes())

	return base64Without, nil
}
